import axios from "axios";
import { API_URL } from "../../config/config";

export const getAllUser = () => {
  return axios.get(API_URL + "users/getAllUser").then((res) => res.data);
};

export const addUser = (userData) => {
  return axios.post(API_URL + "users/addUser", userData).then((res) => res);
};

export const deleteUser = (userInfoId) => {
  return axios
    .delete(API_URL + `users/deleteUserById/${userInfoId}`)
    .then((res) => res);
};
